import React from "react";
import './Login.css';
import TopBar from '../TopBar/TopBar';

const Login = () => {

    return(
        <>
        <TopBar />
        <div id="loginBox">

        <input id="userName" name="userName" placeholder="Enter user name" type="text" />
        <input id="password" name="password" placeholder="Password" type="Enter password" />
        </div>
        </>
    )


};

export default Login;
